let currentBookmarklet = null;

    function showOptions(bookmarklet) {
        const modal = document.getElementById('optionsModal');
        const bookmarkLink = document.getElementById('bookmarkLink');
        
        currentBookmarklet = bookmarklet;
        document.getElementById('modalTitle').textContent = bookmarklet.name;
        bookmarkLink.href = bookmarklet.code;
        bookmarkLink.textContent = bookmarklet.name;
        
        modal.classList.add('active');
        document.body.classList.add('modal-active');
    }

    function closeModal() {
        const modal = document.getElementById('optionsModal');
        modal.classList.remove('active');
        document.body.classList.remove('modal-active');
        currentBookmarklet = null;
    }

    function createCategorySections() {
        const container = document.getElementById('bookmarklet-sections');
        container.innerHTML = '';
        
        // Get all unique categories and sort them with "cheats" first
        const categories = [...new Set(bookmarklets.map(b => b.category))];
        
        // Sort categories with "cheats" first, then alphabetically
        categories.sort((a, b) => {
            if (a === 'cheats') return -1;
            if (b === 'cheats') return 1;
            return a.localeCompare(b);
        });
        
        categories.forEach(category => {
            // Create section div
            const sectionDiv = document.createElement('div');
            sectionDiv.className = 'section';
            
            // Create heading
            const heading = document.createElement('h2');
            heading.textContent = category.charAt(0).toUpperCase() + category.slice(1); // Capitalize first letter
            sectionDiv.appendChild(heading);
            
            // Create buttons container
            const buttonsContainer = document.createElement('div');
            buttonsContainer.className = 'buttons-here';
            sectionDiv.appendChild(buttonsContainer);
            
            // Add buttons for this category
            const categoryBookmarklets = bookmarklets.filter(b => b.category === category);
            categoryBookmarklets.forEach(bookmarklet => {
                const btn = document.createElement('button');
                btn.className = 'bookmarklet-btn';
                btn.textContent = bookmarklet.name;
                btn.setAttribute('data-code', bookmarklet.code);
                
                btn.addEventListener('click', function() {
                    showOptions(bookmarklet);
                });
                
                buttonsContainer.appendChild(btn);
            });
            
            container.appendChild(sectionDiv);
        });
    }

    document.addEventListener('DOMContentLoaded', function() {
        createCategorySections();
        
        document.querySelector('.close-btn').addEventListener('click', closeModal);
        
        document.getElementById('copyBtn').addEventListener('click', function() {
            if (currentBookmarklet) {
                navigator.clipboard.writeText(currentBookmarklet.code)
                    .then(() => {
                        alert('code copied to clipboard');
                        closeModal();
                    })
                    .catch(err => {
                        console.error('failed to copy: ', err);
                        alert('failed to copy code, please try again');
                    });
            }
        });
        
        window.addEventListener('click', function(event) {
            const modal = document.getElementById('optionsModal');
            if (event.target === modal) {
                closeModal();
            }
        });
    });